import FormSearch from './FormSearch';
import PictureList from './PictureList';

function App() {

  const styles = {
     h1: {
       marginLeft: '2rem'
     },
     header: {
       display: 'flex',
       flexDirection: 'row',
       justifyContent: 'space-between'
     }
  }

  return (
    <main>
    <div>
      <header style={styles.header}>
        <h1 style={styles.h1}>Picture Search</h1>
        <FormSearch style={styles.FormSearch} />
      </header>
    </div>
      <div>
        <PictureList />
      </div>
    </main>
  );
}

export default App;
